INSERT INTO `t_check_content` VALUES (1,'9 大型起重机械安全监控管理系统检查','9.1 安全监控管理功能要求的硬件配备',NULL,0,'检查起重机械的出厂配套件清单中是否有GB/T 28264—2012《起重机械安全监控管理系统》所要求的号采集单元、信号处理单元、控制输出单元、数据存储单元、信号显示单元、信息接口单元等硬件设施。'),(2,'9 大型起重机械安全监控管理系统检查','9.2 管理权限的设定',NULL,0,'现场核实系统管理员的授权，是否设置登录密码或者更高级的身份识别方式。系统管理员输入正确的密码或者其他识别方式后，是否才能顺利进入系统。'),(3,'9 大型起重机械安全监控管理系统检查','9.3 故障自诊断',NULL,0,'开机进人系统后，现场核实系统是否有运行自检的程序，并且显示自检结果；系统是否具有故障自诊断功能。系统自身发生故障而影响正常使用时，是否能立即发出报警信号。'),(4,'9 大型起重机械安全监控管理系统检查','9.4 报警装置',NULL,0,'在空载的条件下，通过按急停或者系统设计的报警信号现场验证起重机械的各种报警装置的动作。检查系统的报警装置是否能向起重机械操作者和处于危险区域的人员发出清晰的声、光报警信号。在空载的条件下，模拟起重机械监控系统中的1个〜2个监控项目的故障，检查其是否能发出声、光报警信号并且按照设计的设置要求使起重机械止停。'),(5,'9 大型起重机械安全监控管理系统检查','9.5 文字表达形式',NULL,0,'现场目测系统显示的所有界面的文字表达形式是否为简体中文。'),(6,'9 大型起重机械安全监控管理系统检查','9.6 通信协议的开放性',NULL,0,'现场检查系统是否有对外开放的硬件接口，查阅相关说明书中通信协议的内容，是否符合国家现行标准规定的MODBUS、TCP/IP、串口等对外开放的协议；现场验证系统通过以太网或者USB接口是否能方便地将记录数据导出。'),(7,'9 大型起重机械安全监控管理系统检查','9.7 显示信息的清晰度',NULL,0,'在起重机械驾驶人员（司机）座位上，斜视45°，检查是否可以清晰完整地观察到整个监控画面，包括视频系统的画面，画面上显示的信息不刺目、不干扰视线，清晰可辨。'),(8,'9 大型起重机械安全监控管理系统检查','9.8 系统信息采集源',NULL,0,'对应GB/T 28264中表1,检查信息采集源是否符合要求。'),(9,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.1起重量',1,'现场起升载荷，检查显示器上是否显示起重量，显示计量单位是否为“t”，并且是否至少保留小数点后两位。'),(10,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.2 起重力矩',3,'现场起升载荷，并且进行变幅运动，检查显示器上是否显示起重量和相应位置幅度，显示计量单位是否分别为“t”和“m”，并且均至少保留小数点后两位。'),(11,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.3 起升高度（下降深度）',3,'检查显示屏幕上，是否能够实时显示所吊运的物体起升高度和下降深度。在空载的条件下，将吊具起升到一定的位置，记录此时显示屏上起升高度的数值为小，将激光测距仪等检测仪器垂直架设到吊具的正下方，测试吊具的位置高度值 并且记录为h1，将起升机构缓慢运行'),(12,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.4 运行行程',3,'在空载的条件下，将小车运行到某一位置，记录显示屏上小车运行行程的数值为S0，并且在小车运行的轨道上相应位置做标记，缓慢开动小车，移动一定的距离 (一般不少于10mm)，观察显示屏上小车运行行程的数值是否实时变化，待小车稳定后记录显示屏幕上行程数值为并且在运行的轨道上做标记；用卷尺等检测仪器测量两处标记的距离为S,按照公式S =/S1-S0/计算出系统显示的距离，检查S与s数值是否一致；'),(13,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.5 风速',2,'检查系统是否实时显示风速值，记录当前风速值，查看风速计合格证；测量与起重机风速计同一位置的风速，与显示值比较是否一致。现场验证时调低试验报警门槛值，察看其有效性，系统是否能立即发出警报信号，在司机室和起重机周围是否能清晰的观察到声、光报警信号，起重机是否能停止运行。'),(14,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.6 回转角度',3,'检査系统是否实时记录并且显示起重机械的回转角度，实测回转角度数值与系 统显示值进行对比，验证其有效性和准确度。'),(15,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.7 幅度',3,'现场进行变幅运动，检查显示器上是否显示相应位置幅度，显示计量单位是否为“m”，是否至少保留小数点后两位。'),(16,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.8 大车运行偏斜',0,'在空载的条件下，慢速、点动操作起重机两侧支腿电动机，模拟大车运行偏斜状态，观察系统是否显示并且能发出报警信号。'),(17,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.9 水平度',3,'现场检查系统中是否有实时显示整体水平度的数值并且记录，测量起重机主体 结构前后支腿的高低差，验证起重机的整体水平度。'),(18,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.10 同一或者不同一轨道运行机构安全距离',0,'检查系统是否设置有安全距离；当小于设定的安全距离时，检查系统是否有正确响应。现场设置信号反射器具，检查起重机械同一或者不同一轨道存在碰撞危险时，在司机室和起重机械周围是否能清晰的观察到声、光报警信号，起重机械是否停止运行。'),(19,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.11 操作指令',0,'在空载的条件下，根据现场实际情况，对起重机械的动作进行操作验证，检查 各种动作在显示器上是否实时显示。试验后，查看相关的记录，信息能否保存和回放。'),(20,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.12 支腿垂直度',3,'现场检查系统中有实时显示的支腿垂直度的数据并且记录，将数字式角度仪等仪器架设到支腿的下横梁上测量支腿的横向垂直度并且记录，再将数字式角度仪等仪器放置于支腿的垂直面上，根据支腿不同的形式，选取相应位置测量纵向的垂直度并且记录。验证起重机械的支腿垂直度是否符合要求。'),(21,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.13 工作时间',0,'检查系统是否能实时显示和记录工作时间，计量起重机械各机构动作时间点、时间段，与监控系统对应值比较。'),(22,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.14 累计工作时间',0,'进行连续一个工作循环后，调取试验过程中存储的时间数据，现场验证已完成的工作循环的时间系统是累加、记录和存储。'),(23,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.15 每次工作循环',0,'查看显示屏幕上是否有工作循环的次数。根据起重机械的特点记录每个工作循环的次数。调取试验过程中存储的时间数据，检查系统已完成的工作循环是否全部记录和存储。'),(24,'9 大型起重机械安全监控管理系统检查','9.10 监控状态验证','9.10.1 起升机构的制动状态',0,'在空载的条件下，进行起升机构动作的操作，对于两个以上（含两个)起升机构的起重机械，分别验证其制动状态，检查在系统的显示屏上是否实时显示制动状态的信号。'),(25,'9 大型起重机械安全监控管理系统检查','9.10 监控状态验证','9.10.2 抗风防滑状态',0,'现场查看抗风防滑装置的形式，进行夹轨器、锚定等抗风防滑装置的闭合性试验，检査监控系统显示的抗风防滑装置状态是否与动作状态一致。'),(26,'9 大型起重机械安全监控管理系统检查','9.10 监控状态验证','9.10.3 联锁保护(门联锁和机构之间的运行联锁)',0,'（1）进行门联锁开关闭合试验，检查监控系统显示与门联锁状态是否一致；（2）根据相关标准和设计要求，对于有联锁要求的起重机械，在空载的条件下，分别进行两机构的动作，检查机构之间的联锁是否满足规定要求，显示屏是否实时显示联锁状态；对于架桥机，当进行过孔状态的动作时，架桥机架梁状态各机构操作'),(27,'9 大型起重机械安全监控管理系统检查','9.10 监控状态验证','9.10.4 工况设置状态',0,'检查系统中是否有对所有工况进行监控设置、显示和存储功能。现场查看显示、调阅工况资料，验证其有效性。'),(28,'9 大型起重机械安全监控管理系统检查','9.10 监控状态验证','9.10.5 供电电缆卷筒状态',0,'（1）检查系统是否能够监控供电电缆卷筒状态保护开关(过紧或者过松）的动作状态；现场操作供电电缆卷筒状态保护开关断开或者闭合，观察系统是否能识别供电电缆卷筒的状态；（2）检查系统是否能够监控供电电缆卷筒状态保护开关和起重机械大车运行机构 的联锁状态；当供电电缆卷筒状态保护开关断开时，操作起重机械大车运行机构启 动，观察系统是否能够发出报警信号，并且禁止大车运行机构运动。'),(29,'9 大型起重机械安全监控管理系统检查','9.10 监控状态验证','9.10.6 过孔状态',0,'按照架桥机的过孔走行方式进行过孔走行试验，检查系统是否实时显示过孔的状态，试验后查看相关的过孔状态记录，系统是否记录过孔时的操作命令和状态。'),(30,'9 大型起重机械安全监控管理系统检查','9.10 监控状态验证','9.10.7 视频系统',0,'现场查看视频系统，包括装设摄像头数量、安装位置、所监控的范围。在一个工作循环的时间内，检查在视频系统的屏幕上是否观察到起重机械主要机构各主要工况实时工作的监控画面。检查整个视频系统是否全程监控起重机械工作的过程，是否能做到实时监控。一个工作循环后，调取相关视频的信息，查看这些状态的信息是否完整保存。'),(31,'9 大型起重机械安全监控管理系统检查','9.11 系统综合误差试验','9.11.1 起重量综合误差',0,'根据试验工况将小车停放在相应位置，起升机构按100%额定起重量加载，载荷离地100mm〜200mm高度，悬空时间不少于l0min。整个过程中观察系统应当反映起重机械载荷的实时变化，待载荷稳定后观察显 示屏上的载荷数值作为系统显示的数据记录为Ǫa；将现场经过标定的Ǫb试验载荷作为检验载荷的实际数据记录为Ǫb。'),(32,'9 大型起重机械安全监控管理系统检查','9.11 系统综合误差试验','9.11.2 幅度综合误差',0,'按照GB/T 28264中7.2的要求计算幅度综合误差。对于流动式起重机在上述试验的基础上增加额定载荷下的试验。'),(33,'9 大型起重机械安全监控管理系统检查','9.11 系统综合误差试验','9.11.3 起重力矩综合误差',0,'按照GB/T 28264中7.3的要求计算起重力矩的综合误差。'),(34,'9 大型起重机械安全监控管理系统检查','9.12 连续作业试验',NULL,0,'系统按照其工作循环能连续作业16h或者工作循环次数不少于20次，并且能实时记录。通过调取试验后的记录，查看相关的记录，验证系统的连续作业能力。'),(35,'9 大型起重机械安全监控管理系统检查','9.13 信息采集和储存验证','9.13.1 实时性',0,'进行空载试验时，现场验证系统是否具有起重机械作业状态的实时显示功能，能否以图形、图像、图标和文字的方式显示起重机械的工作状态和工作参数。试验结束后，调取保存的记录，验证起重机械运行状态及故障信息是否有实时记录功能。检查系统存储的数据信息或者图像信息是否包含数据或者图像的编号，时间和日期与试验的数据是否一致。'),(36,'9 大型起重机械安全监控管理系统检查','9.13 信息采集和储存验证','9.13.2 扫描周期',0,'查看系统实际程序的扫描周期是否不大于100ms。'),(37,'9 大型起重机械安全监控管理系统检查','9.13 信息采集和储存验证','9.13.3 存储时间',0,'根据设备的使用情况，对于系统工作时间超过30天的起重机械，现场调取之前存储的文件，查看文件的原始完整性和存储情况；存储时间是否不少于30个连续工作日。对于系统工作时间不超过30天的起重机械，现场查阅存储的文件，计算一个工作循环的时间内储存文件大小，推算出是否能达到标准中所规定的要求，数据存储 时间是否不少于30个连续工作日，视频存储时间不少于72h。'),(38,'9 大型起重机械安全监控管理系统检查','9.13 信息采集和储存验证','9.13.4 断电后信息的保存',0,'首先检査系统是否有独立的电源即UPS电源或者电瓶等装置。现场验证起重机 械主机电源断电后，系统能否持续工作。调取连续作业的时间内存储的数据，检查 起重机械数据是否完整保存。'),(39,'9 大型起重机械安全监控管理系统检查','9.13 信息采集和储存验证','9.13.5 历史追溯性',0,'调取连续工作一个工作循环过程中存储的所有信息，检查系统存储的数据信息 或者图像信息是否包含数据或者图像的编号，时间和日期与试验的数据是否一致， 能否追溯到起重机械的运行状态及故障报警信息。');
