INSERT INTO `t_check_record` VALUES (430,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','检查起重机械的出厂配套件清单中是否有GB/T 28264—2012《起重机械安全监控管理系统》所要求的号采集单元、信号处理单元、控制输出单元、数据存储单元、信号显示单元、信息接口单元等硬件设施。',1,'9 大型起重机械安全监控管理系统检查','9.1 安全监控管理功能要求的硬件配备',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(431,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','现场核实系统管理员的授权，是否设置登录密码或者更高级的身份识别方式。系统管理员输入正确的密码或者其他识别方式后，是否才能顺利进入系统。',2,'9 大型起重机械安全监控管理系统检查','9.2 管理权限的设定',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(432,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','开机进人系统后，现场核实系统是否有运行自检的程序，并且显示自检结果；系统是否具有故障自诊断功能。系统自身发生故障而影响正常使用时，是否能立即发出报警信号。',3,'9 大型起重机械安全监控管理系统检查','9.3 故障自诊断',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(433,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','在空载的条件下，通过按急停或者系统设计的报警信号现场验证起重机械的各种报警装置的动作。检查系统的报警装置是否能向起重机械操作者和处于危险区域的人员发出清晰的声、光报警信号。在空载的条件下，模拟起重机械监控系统中的1个〜2个监控项目的故障，检查其是否能发出声、光报警信号并且按照设计的设置要求使起重机械止停。',4,'9 大型起重机械安全监控管理系统检查','9.4 报警装置',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(434,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','现场目测系统显示的所有界面的文字表达形式是否为简体中文。',5,'9 大型起重机械安全监控管理系统检查','9.5 文字表达形式',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(435,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','现场检查系统是否有对外开放的硬件接口，查阅相关说明书中通信协议的内容，是否符合国家现行标准规定的MODBUS、TCP/IP、串口等对外开放的协议；现场验证系统通过以太网或者USB接口是否能方便地将记录数据导出。',6,'9 大型起重机械安全监控管理系统检查','9.6 通信协议的开放性',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(436,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','在起重机械驾驶人员（司机）座位上，斜视45°，检查是否可以清晰完整地观察到整个监控画面，包括视频系统的画面，画面上显示的信息不刺目、不干扰视线，清晰可辨。',7,'9 大型起重机械安全监控管理系统检查','9.7 显示信息的清晰度',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(437,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','对应GB/T 28264中表1,检查信息采集源是否符合要求。',8,'9 大型起重机械安全监控管理系统检查','9.8 系统信息采集源',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(438,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','现场起升载荷，检查显示器上是否显示起重量，显示计量单位是否为“t”，并且是否至少保留小数点后两位。',9,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.1起重量',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(439,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','现场起升载荷，并且进行变幅运动，检查显示器上是否显示起重量和相应位置幅度，显示计量单位是否分别为“t”和“m”，并且均至少保留小数点后两位。',10,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.2 起重力矩',3,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(440,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','检查显示屏幕上，是否能够实时显示所吊运的物体起升高度和下降深度。在空载的条件下，将吊具起升到一定的位置，记录此时显示屏上起升高度的数值为小，将激光测距仪等检测仪器垂直架设到吊具的正下方，测试吊具的位置高度值 并且记录为h1，将起升机构缓慢运行',11,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.3 起升高度（下降深度）',3,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(441,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','在空载的条件下，将小车运行到某一位置，记录显示屏上小车运行行程的数值为S0，并且在小车运行的轨道上相应位置做标记，缓慢开动小车，移动一定的距离 (一般不少于10mm)，观察显示屏上小车运行行程的数值是否实时变化，待小车稳定后记录显示屏幕上行程数值为并且在运行的轨道上做标记；用卷尺等检测仪器测量两处标记的距离为S,按照公式S =/S1-S0/计算出系统显示的距离，检查S与s数值是否一致；',12,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.4 运行行程',3,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(442,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','检查系统是否实时显示风速值，记录当前风速值，查看风速计合格证；测量与起重机风速计同一位置的风速，与显示值比较是否一致。现场验证时调低试验报警门槛值，察看其有效性，系统是否能立即发出警报信号，在司机室和起重机周围是否能清晰的观察到声、光报警信号，起重机是否能停止运行。',13,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.5 风速',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(443,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','检査系统是否实时记录并且显示起重机械的回转角度，实测回转角度数值与系 统显示值进行对比，验证其有效性和准确度。',14,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.6 回转角度',3,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(444,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','现场进行变幅运动，检查显示器上是否显示相应位置幅度，显示计量单位是否为“m”，是否至少保留小数点后两位。',15,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.7 幅度',3,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(445,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','在空载的条件下，慢速、点动操作起重机两侧支腿电动机，模拟大车运行偏斜状态，观察系统是否显示并且能发出报警信号。',16,'9 大型起重机械安全监控管理系统检查','9.9 监控参数验证','9.9.8 大车运行偏斜',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(446,21,0,'2020-10-26 10:45:40','2020-10-26 10:45:40','张三','现场检查系统中是否有实时显示整体水平度的数值并且记录，测量起重机主体 结构前后支